import styled from "styled-components";

export const Wrapper = styled.div`
  background-color: #eaeaea;
  width: 100%;
  input {
    padding: 1.25rem;
    margin-bottom: 1rem;

    border: 0;
  }
  svg {
    position: relative;
  }
`;
